import "./App.scss";
import PictureGrid from "./components/2-PictureGrid";
import ModernArtGallery from "./components/ModernArtGallery";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
      <ModernArtGallery />
      <PictureGrid />
      <Footer />
    </div>
  );
}

export default App;
